              var glyphWidths = Metrics[lookupName];

              if (isNum(glyphWidths)) {
                defaultWidth = glyphWidths;
                monospace = true;
              } else {
                widths = glyphWidths(); // expand lazy widths array
              }

              return {
                defaultWidth: defaultWidth,
                monospace: monospace,
                widths: widths,
              };
