$(function () {
  const input = $('.output').text();
  const output = document.querySelector('.output');
  const outputContainer = document.querySelector('.container');

  function resize_to_fit() {
    let fontSize = window.getComputedStyle(output).fontSize;
    output.style.fontSize = parseFloat(fontSize) - 1 + 'px';

    if (output.clientHeight >= outputContainer.clientHeight) {
      resize_to_fit();
    }
  }

  function processInput() {
    output.innerHTML = input;
    output.style.fontSize = '52px'; // Default font size
    resize_to_fit();
  }
  processInput();

  $('img').each(function () {
    // $(this).attr('crossorigin','anonymous');
    $(this).off('mouseenter.tooltip mouseleave.tooltip');
  });

  //get actual height of the zoning description div and add class to add ... content
  var height;
  if ($('.property-zoning-section.property-des-block')[0])
    height = $('.property-zoning-section.property-des-block')[0].scrollHeight;
  else height = 0;

  if (height > 490) {
    $('.property-zoning-section.property-des-block').addClass(
      'truncate-overflow-text'
    );
  }

  //Before printing, remove the box-shadow and the bottom margin
  $(window).bind('beforeprint', function () {
    $('.new-page').each(function (index, value) {
      $(value).css('box-shadow', 'none');
      $(value).css('margin-bottom', '0');
    });
    $('#print-bov').hide();
  });

  //After printing, add the box-shadow and the bottom margin
  $(window).bind('afterprint', function () {
    $('.new-page').each(function (index, value) {
      $(value).css('box-shadow', '0 0 1cm rgba(0, 0, 0, 0.1)');
      $(value).css('margin-bottom', '10px');
    });

    $('#print-bov').show();
  });
  // Image rotation check
  setTimeout(function () {
    checkOrientation();
  }, 1000);
  setTimeout(function () {
    checkOrientation();
  }, 5000);
  function checkOrientation() {
    $('.pdf-png-section img.exhibits-image').removeClass('landscape');
    $('.pdf-png-section img.exhibits-image').removeClass('portrait');
    for (var i = 0; i < $('.pdf-png-section .exhibits-image').length; i++) {
      var someImg = $('.pdf-png-section img.exhibits-image').eq(i);
      if (someImg.on('load')) {
        if (someImg.width() > someImg.height()) {
          someImg.addClass('landscape');
        } else if (someImg.width() < someImg.height()) {
          someImg.addClass('portrait');
        } else {
          someImg.addClass('square');
        }
      }
    }
  }
  $(window).on('load', function () {
    checkOrientation();
    let page_num = 1;
    $('.new-page').each(function () {
      let children = $(this).children().find('.pagenum');
      if ($(this).css('display') !== 'none') {
        children.html(page_num);
        children.addClass('pagenumPDF');
        children.removeClass('pagenum');
        page_num++;
      }
    });
  });
});

$(document).ready(function () {
  // showLoading();
  var openedModal = false;

  function initCarousel() {
    if (!openedModal) {
      $('.carousel').carousel({
        fullWidth: true,
        indicators: true,
      });
      openedModal = true;
    }
  }

  function ucfirst(str) {
    var pieces = str.split(' ');
    for (var i = 0; i < pieces.length; i++) {
      var j = pieces[i].charAt(0).toUpperCase();
      pieces[i] = j + pieces[i].substr(1);
    }
    return pieces.join(' ');
  }

  function loadExhibitModalStop() {
    var imgContainers = $('[data-image]');
    imgContainers.off('click');
    imgContainers.unbind('mouseenter');
    imgContainers.unbind('mouseleave');
  }

  function loadExhibitModal() {
    var imgContainers = $('[data-image]');

    imgContainers.css('cursor', 'hand');

    $.each(imgContainers, function (index, value) {
      $(value).attr('data-tooltip', 'Click in the image to change it.');

      $(value).tooltip({
        delay: 50,
        position: 'bottom',
      });
    });

    imgContainers.click(function () {
      //Open the modal
      var $this = $(this);
      var exhibitsModal = $('#exhibits');
      exhibitsModal.modal();
      exhibitsModal.modal('open');

      //Init the carousel
      initCarousel();

      //Set image name in the form
      $("input[name='image-name']").val($this.attr('data-image-name'));

      //Get image index
      var n = $(
        '[data-url="' +
          $this.attr('src').replace($('body').attr('data-cdn-url'), '') +
          '"]'
      ).attr('data-number');

      //Select image in the carousel if any
      if (n) {
        $('.carousel').carousel('set', n);
      }
    });

    imgContainers
      .mouseenter(function () {
        $(this).fadeTo('fast', 0.5);
      })
      .mouseleave(function () {
        $(this).fadeTo('fast', 1);
      });

    $('.modal-insert').click(function () {
      showLoading();
      var body = $('body');
      var baseUrl = body.attr('data-base-url');
      var item = $('.carousel-item.active');
      var imageName = $("input[name='image-name']").val();
      var type = 'image';
      var source = item.children().attr('src');

      $.post(
        baseUrl + 'wggenerator/saveMeta',
        {
          id: body.attr('data-evaluation-id'),
          name: imageName,
          val: item.attr('data-url'),
          type: type,
          source: source,
        },
        function (data) {
          $("[data-image-name='" + imageName + "']")
            .attr('src', body.attr('data-cdn-url') + item.attr('data-url'))
            .addClass('image-added');

          $('#exhibits').modal('close');
        }
      ).done(function () {
        hideLoading();
      });
    });
  }

  function reduceText(text, length) {
    var pieces = text.split('.');

    var i;
    var total = pieces.length;
    var newStr = '';
    for (i = 0; i < total; i++) {
      if (newStr.length + pieces[i].length <= length) {
        newStr += pieces[i] + '.';
      }
    }

    newStr.replace('..', '.');

    return newStr;
  }

  function loadPages() {
    var pages = $('.new-page:not(.hide)');

    pages.each(function (i, el) {
      $(el).attr('data-page-number', i + 1);
    });

    var contents = $('[data-table-of-contents]');

    contents.each(function (i, el) {
      var $el = $(el);
      var type = $el.attr('data-table-of-contents');
      var num = $("[data-type='" + type + "']").attr('data-page-number');
      if (parseInt(num) < 10) {
        $el.html('0' + num);
      } else {
        $el.html(num);
      }
    });
  }

  function initSvgs() {
    document.querySelectorAll('img.svg').forEach(function (img) {
      var imgID = img.id;
      var imgClass = img.className;
      var imgURL = img.src;

      fetch(imgURL)
        .then(function (response) {
          return response.text();
        })
        .then(function (text) {
          var parser = new DOMParser();
          var xmlDoc = parser.parseFromString(text, 'text/xml');

          // Get the SVG tag, ignore the rest
          var svg = xmlDoc.getElementsByTagName('svg')[0];

          // Add replaced image's ID to the new SVG
          if (typeof imgID !== 'undefined') {
            svg.setAttribute('id', imgID);
          }
          // Add replaced image's classes to the new SVG
          if (typeof imgClass !== 'undefined') {
            svg.setAttribute('class', imgClass + ' replaced-svg');
          }

          // Remove any invalid XML tags as per http://validator.w3.org
          svg.removeAttribute('xmlns:a');

          // Check if the viewport is set, if the viewport is not set the SVG wont't scale.
          if (
            !svg.getAttribute('viewBox') &&
            svg.getAttribute('height') &&
            svg.getAttribute('width')
          ) {
            svg.setAttribute(
              'viewBox',
              '0 0 ' +
                svg.getAttribute('height') +
                ' ' +
                svg.getAttribute('width')
            );
          }

          // Replace image with new SVG
          img.parentNode.replaceChild(svg, img);
        });
    });
  }
  function showLoading() {
    $('#evaluation-report').LoadingOverlay('show', {
      image: $('body').attr('loader-image'),
      imageAnimation: '2500ms rotate_left',
      zIndex: 9999,
      background: 'rgba(255, 255, 255, 0.95)',
    });
  }
  function hideLoading() {
    $('#evaluation-report').LoadingOverlay('hide');
  }
  $('#checkPDFComplete').change(function () {
    pdf.save('Evaluation Report_Harken CRE.pdf');
    $('#print-bov').removeClass('hide');
    $('.new-page').css('margin-bottom', '10px');
    $('.new-page').css('box-shadow', ' 0 0 1cm rgba(0, 0, 0, 0.1)');
    hideLoading();
    pdf = new jsPDF('l', 'pt', 'letter', true);
  });
  var scale = 2.5;
  var body = $('body');
  var proxyUrl = body.attr('proxy-url');
  var pdf = new jsPDF('l', 'pt', 'letter', true);
  let pageCountForPdf = 0;
  function initPrintBtn() {
    $('#print-bov').click(async function () {
      showLoading();
      $(this).addClass('hide');
      scrolldelay = setInterval(function () {
        window.scrollBy(0, 400);
        if (
          window.innerHeight + window.pageYOffset >=
          document.body.offsetHeight
        ) {
          clearInterval(scrolldelay);
          window.scrollTo(0, 0);
          print();
        }
      }, 100);
      async function print() {
        var obj = $('#print-bov');
        $(obj).addClass('hide');
        var flag = true;
        let pageCount = 10;
        let changeCount = 0;
        let pageClass = 1;
        $('.new-page').each(function () {
          if (
            $(this).css('display') !== 'none' &&
            $(this).children().find('.flex').length
          ) {
            $(this).addClass('hide');
            flag = false;
          } else if (changeCount <= pageCount) {
            $(this).addClass('new-page-' + pageClass);
          }
          if (changeCount == pageCount) {
            pageClass++;
            pageCount = pageCount + 10;
          }
          changeCount++;
        });
        $('.new-page').css('margin-bottom', '0px');
        $('.new-page').css('box-shadow', 'unset');
        var elementHTML = document.getElementById('evaluation-report-data');
        $('.gm-control-active').addClass('hide');
        $('.gmnoprint').addClass('hide');

        var pageHeight = 812.7 * scale;
        var pageWidth = 1312 * scale;
        var color = $('#evaluation-report-data').attr('data-color');

        $('.new-page-1').wrapAll("<div id='new-page-1'></div>");
        await renderPDFPage($('#new-page-1')[0], 1);

        async function renderPDFPage(elementHTML, count) {
          result = await html2canvas(elementHTML, {
            proxy: proxyUrl,
            scale: scale,
          }).then(function (canvas) {
            var checkHeight = (elementHTML.clientHeight * scale) / pageHeight;
            if (checkHeight) {
              for (var i = 0; i <= checkHeight; i++) {
                var srcImg = canvas;
                var sX = 0;
                var sY = pageHeight * i; // start 1 pageHeight down for every new page
                var sWidth = pageWidth;
                var sHeight = pageHeight;
                var dX = 0;
                var dY = 0;
                var dWidth = pageWidth;
                var dHeight = pageHeight + 2;

                window.onePageCanvas = document.createElement('canvas');
                onePageCanvas.setAttribute('width', pageWidth);
                onePageCanvas.setAttribute('height', pageHeight);
                onePageCanvas.setAttribute('background', '#ffffff');
                var ctx = onePageCanvas.getContext('2d');
                ctx.webkitImageSmoothingEnabled = false;
                ctx.mozImageSmoothingEnabled = false;
                ctx.imageSmoothingEnabled = false;
                ctx.drawImage(
                  srcImg,
                  sX,
                  sY,
                  sWidth,
                  sHeight,
                  dX,
                  dY,
                  dWidth,
                  dHeight
                );

                var canvasDataURL = onePageCanvas.toDataURL('image/jpeg', 1.0);

                if (pageCountForPdf > 0)
                  // if we're on anything other than the first page, add another page
                  pdf.addPage('l', 'pt', 'letter');
                pdf.setPage(pageCountForPdf + 1); // now we declare that we're working on that page

                pageCountForPdf = pageCountForPdf + 1;
                pdf.addImage(
                  canvasDataURL,
                  'jpeg',
                  5,
                  5,
                  980,
                  580,
                  undefined,
                  'FAST'
                );
              }
            }
          });
          count++;
          if (count > 1) {
            $('.new-page-' + count).wrapAll(
              "<div id='new-page-" + count + "'></div>"
            );
          }
          // if(count==pageClass){
          if (count > pageClass) {
            if (flag) {
              pdf.save('Evaluation Report_Harken CRE.pdf');
              $('#print-bov').removeClass('hide');
              $('.new-page').css('margin-bottom', '10px');
              $('.new-page').css('box-shadow', ' 0 0 1cm rgba(0, 0, 0, 0.1)');
              hideLoading();
            } else {
              await renderPDF(0);
            }
            return;
          } else {
            if ($('#new-page-' + count).length) {
              await renderPDFPage($('#new-page-' + count)[0], count);
            } else {
              if (flag) {
                pdf.save('Evaluation Report_Harken CRE.pdf');
                $('#print-bov').removeClass('hide');
                $('.new-page').css('margin-bottom', '10px');
                $('.new-page').css('box-shadow', ' 0 0 1cm rgba(0, 0, 0, 0.1)');
                hideLoading();
              } else {
                await renderPDF(0);
              }
            }
          }
        }
        async function renderPDF(index) {
          if (index < $('.new-page').length) {
            //pdf render
            var element = $('.new-page')[index];
            $(element).removeClass('hide');
            var imgWidth = 780;
            var imgMargin = 5;
            if ($(element).children().find('.flex').length) {
              var watermark = $(element).children().find('.subtitle').html();
              if ($(element).children().find('canvas').hasClass('portrait')) {
                imgWidth = 430;
                imgMargin = 150;
              }
              let sX = 0;
              let sY = pageHeight;
              let sWidth = pageWidth;
              let sHeight = pageHeight;
              let dX = 0;
              let dY = 0;
              let dWidth = pageWidth;
              let dHeight = pageHeight;
              if ($(element).children().find('canvas').length) {
                let canvasLength = $(element).children().find('canvas').length;
                let checkLength = 1;
                await $(element)
                  .children()
                  .find('canvas')
                  .each(async function () {
                    let selectedElement = $(this).get(0);
                    result = await html2canvas(element, {
                      proxy: proxyUrl,
                    }).then(async function (canvas) {
                      canvas = selectedElement;
                      let srcImg = canvas;
                      if (canvas.height) {
                        window.onePageCanvas = document.createElement('canvas');
                        onePageCanvas.setAttribute('width', pageWidth);
                        onePageCanvas.setAttribute('height', pageHeight);
                        let ctx = onePageCanvas.getContext('2d');
                        ctx.drawImage(
                          srcImg,
                          sX,
                          sY,
                          sWidth,
                          sHeight,
                          dX,
                          dY,
                          dWidth,
                          dHeight
                        );

                        let canvasDataURL = canvas.toDataURL('image/jpg');
                        pdf.addPage('l', 'pt', 'letter');
                        pdf.setTextColor(color);
                        pdf.setFontSize(20);
                        pdf.text(30, 40, watermark);
                        pdf.addImage(
                          canvasDataURL,
                          'jpg',
                          imgMargin,
                          45,
                          imgWidth,
                          530,
                          undefined,
                          'FAST'
                        );
                        if (
                          index == $('.new-page').length - 1 &&
                          canvasLength == checkLength
                        ) {
                          $('#checkPDFComplete').val(true).change();
                        }
                      }
                    });
                    checkLength++;
                  });
              } else {
                if ($(element).children().find('.flex').length) {
                  await $(element)
                    .children()
                    .find('.flex')
                    .each(async function () {
                      // setTimeout(async () => {
                      result = await html2canvas(this, {
                        proxy: proxyUrl,
                      }).then(function (canvas) {
                        let srcImg = canvas;
                        if (canvas.height) {
                          window.onePageCanvas =
                            document.createElement('canvas');
                          onePageCanvas.setAttribute('width', pageWidth);
                          onePageCanvas.setAttribute('height', pageHeight);
                          let ctx = onePageCanvas.getContext('2d');
                          ctx.drawImage(
                            srcImg,
                            sX,
                            sY,
                            sWidth,
                            sHeight,
                            dX,
                            dY,
                            dWidth,
                            dHeight
                          );

                          let canvasDataURL = canvas.toDataURL(
                            'image/jpg',
                            1.0
                          );
                          pdf.addPage('l', 'pt', 'letter');
                          pdf.setTextColor(color);
                          pdf.setFontSize(20);
                          pdf.text(30, 40, watermark);
                          pdf.addImage(
                            canvasDataURL,
                            'jpg',
                            imgMargin,
                            45,
                            imgWidth,
                            530,
                            undefined,
                            'FAST'
                          );
                          if (index == $('.new-page').length - 1) {
                            $('#checkPDFComplete').val(true).change();
                          }
                        }
                      });
                      // },100);
                    });
                }
              }
            }
            const indexFinal = parseInt(index + 1);
            setTimeout(async () => {
              await renderPDF(indexFinal);
            }, 200);
          }
        }
      }
    });
  }

  function loadPdfExhibits() {
    $('[data-exhibits-pdf]').hide();

    $('[data-exhibits-pdf]').each(function (i, el) {
      var pdfDoc,
        totalPages = 0;

      var pdf_count = $(el).data('exhibits-pdf');
      var cnt = 0;
      var request = new XMLHttpRequest();
      var pdfs = [$(el).data('exhibits-url'), $(el).data('exhibits-url')];

      function chunk(arr, size) {
        var myArray = [];
        for (var i = 0; i < arr.length; i += size) {
          myArray.push(arr.slice(i, i + size));
        }
        return myArray;
      }

      function renderImage(canvasEl, page) {
        var canvas = document.createElement('canvas');
        canvas.classList.add('exhibits-image');
        canvasEl.find('.flex').append(canvas);
        var context = canvas.getContext('2d');
        canvas.style.height = '600px';
        canvas.style.width = canvasEl.width() / 2 + 'px';

        var scale = 4;
        var viewport = page.getViewport(scale);
        canvas.height = viewport.height;
        canvas.width = viewport.width;

        if (canvas.height > canvas.width) {
          canvas.classList.add('portrait');
        } else if (canvas.width > canvas.height) {
          canvas.classList.add('landscape');
        }
        var renderContext = {
          canvasContext: context,
          viewport: viewport,
        };
        page.render(renderContext);
      }

      class PageSize {
        constructor(width, height) {
          this.width = width;
          this.height = height;
        }
      }
      function getPageSize(page) {
        const [x, y, w, h] = page.pageInfo.view;
        const width = w - x;
        const height = h - y;
        const rotate = page.pageInfo.rotate;
        // Consider rotation
        return rotate === 90 || rotate === 270
          ? new PageSize(height, width)
          : new PageSize(width, height);
      }

      function getPdf(pdf_count, pdfs) {
        request.open('GET', pdfs[cnt], true);
        request.responseType = 'blob';
        request.onload = function () {
          var reader = new FileReader();
          reader.readAsDataURL(request.response);
          reader.onload = function (e) {
            PDFJS.getDocument({ url: e.target.result }).then(
              function (pdf_doc) {
                pdfDoc = pdf_doc;
                pdfDoc.getPage(1).then(function (pageWH) {
                  var page_info = getPageSize(pageWH);
                  var portrait = page_info.height > page_info.width;
                  var cnt = 1;
                  if (portrait) {
                    cnt = 2;
                  }

                  totalPages = pdfDoc.numPages;
                  if (totalPages % 2 != 0) {
                    totalPages = totalPages + 1;
                  }
                  var pages = [];
                  for (var page_no = totalPages; page_no >= 1; page_no--) {
                    pages.push(page_no);
                  }

                  var chunked_pages = chunk(pages, cnt);

                  chunked_pages.forEach(function (element) {
                    var canvasEl = $(el).clone();
                    canvasEl.removeAttr('data-exhibits-pdf');
                    $(el).after(canvasEl);
                    canvasEl.show();

                    if (element.length == 2) {
                      pdfDoc.getPage(element[1]).then(function (page) {
                        renderImage(canvasEl, page);
                      });
                      if (
                        pdfDoc.numPages % 2 != 1 ||
                        element[0] !== totalPages
                      ) {
                        pdfDoc.getPage(element[0]).then(function (page) {
                          renderImage(canvasEl, page);
                        });
                      }
                    } else {
                      pdfDoc.getPage(element[0]).then(function (page) {
                        renderImage(canvasEl, page);
                      });
                    }
                  });
                });
              }
            );
          };
        };
        request.send();
      }

      getPdf(pdf_count, pdfs);
    });
  }
  initPrintBtn();
  initSvgs();
  loadPages();
  loadPdfExhibits();
});
